import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>HOME</h1>
        <nav>
          <li>
            USER
          </li>
          <li>
            CARRIER
          </li>
          <li>
            RESTAURANT
          </li>
        </nav>
      </header>
    </div>
  );
}

export default App;
